// JavaScript source code
import React from 'react';
import './Navigation.css';

function Navigation() {
    return (
        <ul className="Navigation">
            <li> <div >New Post</div></li>
            <li> <div >Published</div></li>
        </ul>
        );
}

export default Navigation;
